import{_ as r,c as t,a5 as a,G as s,B as l,o}from"./chunks/framework.O9ad3XaM.js";const m=JSON.parse('{"title":"ServiceIO","description":"","frontmatter":{"title":"ServiceIO","sidebar_position":2},"headers":[],"relativePath":"Java/process/plugin/Front-Plugin/Vault/ServiceIO.md","filePath":"nitwikit/docs-java/process/plugin/Front-Plugin/Vault/ServiceIO.md","lastUpdated":1743764340000}'),c={name:"Java/process/plugin/Front-Plugin/Vault/ServiceIO.md"};function n(h,e,v,p,u,d){const i=l("nw-image-viewer");return o(),t("div",null,[e[0]||(e[0]=a('<h1 id="serviceio" tabindex="-1">ServiceIO <a class="header-anchor" href="#serviceio" aria-label="Permalink to &quot;ServiceIO&quot;">​</a></h1><p><a href="https://github.com/TheNextLvl-net/service-io/releases" target="_blank" rel="noreferrer"><img src="https://img.shields.io/github/v/release/TheNextLvl-net/service-io" alt=""></a><a href="https://github.com/TheNextLvl-net/service-io" target="_blank" rel="noreferrer"><img src="https://img.shields.io/github/languages/code-size/TheNextLvl-net/service-io" alt=""></a><a href="https://github.com/TheNextLvl-net/service-io/blob/main/LICENSE" target="_blank" rel="noreferrer"><img src="https://img.shields.io/github/license/TheNextLvl-net/service-io" alt=""></a></p><p>一个现代的 Vault 替代品，旨在提供增强功能、更好性能和插件间无缝集成</p><div class="tip custom-block"><p class="custom-block-title">提示</p><p>ServiceIO 仅支持 Paper 的最新版本（1.21+）</p><p>ServiceIO旨在作为 Vault 的全面替代，可以直接删除 Vault 插件，所有依赖 Vault 的现有插件将继续无缝与 ServiceIO 协同工作。</p></div><h2 id="为何选择serviceio" tabindex="-1">为何选择ServiceIO？ <a class="header-anchor" href="#为何选择serviceio" aria-label="Permalink to &quot;为何选择ServiceIO？&quot;">​</a></h2><p>ServiceIO是 VaultAPI 过时限制的前沿解决方案。尽管 Vault 仍然可用，但它依赖于已弃用和支持的代码，迫使开发者处理不安全的 null 接口，可能导致不稳定性与错误。</p><p>ServiceIO 通过提供强大的 null 标注、全面的文档和维护良好的源码解决了这些问题。此外，它支持异步数据加载和缓存结果，提升性能和扩展性。</p><p>ServiceIO 的一个关键特性是与现有 Vault 接口的无缝集成，允许插件同时使用两个 API，无需额外修改代码。这确保了平稳过渡，同时利用现代、可靠的平台优势。</p><p>此外，ServiceIO 支持不同插件间的数据转换，包括 banks, permissions, chat 和 groups。</p><p>这消除了开发者编写自定义转换逻辑的需要，节省时间和精力。对于服务器所有者而言，这意味着更换插件比以往任何时候都更为顺畅，确保操作平稳且灵活，而无需手动迁移数据的烦恼。</p><h2 id="命令" tabindex="-1">命令 <a class="header-anchor" href="#命令" aria-label="Permalink to &quot;命令&quot;">​</a></h2><ul><li>/service convert banks：转换所有 banks 和 bank accounts</li><li>/service convert chat：转换所有聊天数据（前缀、后缀、昵称等）</li><li>/service convert economy：转换所有经济数据（账户和余额）</li><li>/service convert groups：转换所有群组数据（群组、前缀、后缀、权限、成员）</li><li>/service convert permissions：转换所有权限数据（用户、权限）</li></ul><h2 id="信息" tabindex="-1">信息 <a class="header-anchor" href="#信息" aria-label="Permalink to &quot;信息&quot;">​</a></h2><ul><li>/service info bank: 查看已安装的 bank 提供插件</li><li>/service info chat: 查看已安装的 chat 提供插件</li><li>/service info economy: 查看已安装的经济提供插件</li><li>/service info groups: 查看已安装的群组提供插件</li><li>/service info permissions: 查看已安装的权提供插件</li></ul><h2 id="权限" tabindex="-1">权限 <a class="header-anchor" href="#权限" aria-label="Permalink to &quot;权限&quot;">​</a></h2><ul><li>/service convert：需要 service.convert</li><li>/service info：需要 service.info</li><li>service.admin 权限允许访问所有 ServiceIO 命令</li><li>且 vault.admin 等同于 service.admin</li></ul><h2 id="链接" tabindex="-1">链接 <a class="header-anchor" href="#链接" aria-label="Permalink to &quot;链接&quot;">​</a></h2><div class="info custom-block"><p class="custom-block-title">信息</p><p><code>Hangar</code> <a href="https://hangar.papermc.io/TheNextLvl/ServiceIO" target="_blank" rel="noreferrer">https://hangar.papermc.io/TheNextLvl/ServiceIO</a></p><p><code>MineBBS</code> <a href="https://www.minebbs.com/resources/.10012" target="_blank" rel="noreferrer">https://www.minebbs.com/resources/.10012</a></p><p><code>GitHub</code> <a href="https://github.com/TheNextLvl-net/service-io" target="_blank" rel="noreferrer">https://github.com/TheNextLvl-net/service-io</a></p></div><h2 id="联系" tabindex="-1">联系 <a class="header-anchor" href="#联系" aria-label="Permalink to &quot;联系&quot;">​</a></h2><p><a href="https://thenextlvl.net/discord" target="_blank" rel="noreferrer"><img src="https://img.shields.io/discord/1293606111177609277?logo=discord&amp;label=Discord" alt=""></a> &lt;- 点击加入 作者的 Discord</p><h2 id="bstats" tabindex="-1">Bstats <a class="header-anchor" href="#bstats" aria-label="Permalink to &quot;Bstats&quot;">​</a></h2><p><a href="https://bstats.org/plugin/bukkit/TheNextLvl%20ServiceIO/23083" target="_blank" rel="noreferrer"><img src="https://bstats.org/signatures/bukkit/TheNextLvl%20ServiceIO.svg" alt=""></a></p>',22)),s(i)])}const g=r(c,[["render",n]]);export{m as __pageData,g as default};
